import React from 'react'

const Section6 = () => {

    let gender = 'male';
    let age = '25'
    let colors = ['Black ', 'White']

  return (
    <div>
        <h2>
            This is section 6 component
        </h2>
        <h2>
            Samuel is a {gender} contestant  and he's {age} years old and likes these colors {colors}
        </h2>

        <marquee behavior="" direction="right">myTECH</marquee>



    </div>
  )

}

export default Section6
